import Layout from "../components/Layout";
import Link from "next/link";

const Details = () => (
  <Layout>
    <div>
      <h1>About Page</h1>
      <p>View Cocktails</p>
      <a href="/">Go Back</a>
    </div>
  </Layout>
)

export default Details;
